<!DOCTYPE html>
<html lang="id">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Surprise Buat Kamu</title>
  <style>
    body {
      margin: 0;
      font-family: 'Poppins', sans-serif;
      background-color: white;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      transition: background-color 0.6s ease;
    }
    #startStage, #questionStage, #envelopeStage {
      text-align: center;
    }
    #questionStage, #envelopeStage {
      display: none;
      opacity: 0;
      transform: scale(0.95);
      transition: opacity 0.6s ease, transform 0.6s ease;
    }
    .love-emoji {
      width: 120px;
      height: 120px;
      cursor: pointer;
      filter: drop-shadow(0 0 12px rgba(255, 105, 180, 0.55));
      animation: glowPulse 2s ease-in-out infinite;
      transition: transform 0.3s ease;
    }
    .love-emoji:hover { transform: scale(1.1); }
    @keyframes glowPulse {
      0% { filter: drop-shadow(0 0 8px rgba(255,105,180,0.35)); transform: scale(1); }
      50% { filter: drop-shadow(0 0 18px rgba(255,105,180,0.7)); transform: scale(1.06); }
      100% { filter: drop-shadow(0 0 8px rgba(255,105,180,0.35)); transform: scale(1); }
    }
    button {
      background: linear-gradient(90deg,#ff5ea1,#ff87c7);
      border: none;
      color: white;
      border-radius: 999px;
      padding: 10px 20px;
      margin: 8px;
      font-size: 16px;
      font-weight: 600;
      cursor: pointer;
      transition: transform 0.2s ease;
      box-shadow: 0 4px 14px rgba(255,105,180,0.3);
    }
  
    @media (max-width: 480px) {
      .love-emoji {
        width: 90px;
        height: 90px;
      }
      button {
        font-size: 14px;
        padding: 8px 16px;
      }
      h2 {
        font-size: 18px;
      }
      #letter {
        font-size: 14px;
        max-width: 90%;
      }
      img {
        max-width: 140px !important;
      }
    }
    </style>
</head>

    <h2 id="subtitle">Kamu sayang sama aku gak? 💕</h2>
    <button id="iyaBtn">Iya</button>
    <button id="gakBtn">Gak</button>
    <p id="reactionText" style="color:#ff3d7f;font-weight:600;"></p>
  </div>

  <div id="envelopeStage">
    <h2>💌 Klik suratnya 💌</h2>
    <button id="envelopeBtn">📩</button>
    <p id="letter" style="display:none;max-width:300px;margin:16px auto;color:#b64b7d;">
      Haee cewee kiwkiw~ 😂<br>
      Aku cuma mau bilang kalau kamu itu berarti banget buat aku.<br>
      Terima kasih banyak yaa. Semoga hari-harimu dipenuhi senyum.<br>
      Aku sayang kamu ❤️
    </p>
  </div>

  <script>
    const loveBtn = document.getElementById('loveBtn');
    const startStage = document.getElementById('startStage');
    const questionStage = document.getElementById('questionStage');
    const envelopeStage = document.getElementById('envelopeStage');
    const subtitle = document.getElementById('subtitle');
    const iyaBtn = document.getElementById('iyaBtn');
    const gakBtn = document.getElementById('gakBtn');
    const reactionText = document.getElementById('reactionText');
    const envelopeBtn = document.getElementById('envelopeBtn');
    const letter = document.getElementById('letter');

    const angryTexts = [
      "Ih jahat 😠", "Kok gitu sih 😢", "Hmmm kesel aku 😤",
      "Coba klik iya deh 😡", "Awas ya kamu 😾", "Mau ngambek nih 😩",
      "Klik iya cepet! 😒", "Hadeh 😮‍💨", "Yaampun 😑", "Hmmmmm 😟"
    ];

    let gakCount = 0;

    loveBtn.addEventListener('click', () => {
      document.body.style.backgroundColor = '#ffe4f2';
      startStage.style.display = 'none';
      questionStage.style.display = 'block';
      setTimeout(() => {
        questionStage.style.opacity = 1;
        questionStage.style.transform = 'scale(1)';
      }, 50);
    });

    gakBtn.addEventListener('click', () => {
      gakCount++;
      const randomText = angryTexts[Math.floor(Math.random() * angryTexts.length)];
      reactionText.textContent = randomText;
      iyaBtn.style.transform = `scale(${1 + gakCount*0.2})`;
    });

    iyaBtn.addEventListener('click', () => {
      subtitle.textContent = "Yey! Aku juga sayang kamu 💕";
      questionStage.style.display = 'none';
      envelopeStage.style.display = 'block';

      // Confetti effect with safe emojis
      const confetti = document.createElement('div');
      confetti.style.position='fixed';
      confetti.style.inset='0';
      confetti.style.pointerEvents='none';
      document.body.appendChild(confetti);
      const emojis = ['💖','✨','💕','💌','🌸','❤️','💓'];
      for(let i=0;i<18;i++){ 
        const el = document.createElement('div');
        el.textContent = emojis[Math.floor(Math.random()*emojis.length)];
        el.style.position='absolute';
        el.style.left = Math.random()*100+'%';
        el.style.top = Math.random()*50+'%';
        el.style.fontSize = (8+Math.random()*28)+'px';
        el.style.opacity = Math.random();
        el.style.transform = 'translateY(-10vh)';
        confetti.appendChild(el);
        el.animate([
          {transform:'translateY(-10vh) rotate(0deg)', opacity:1},
          {transform:'translateY(60vh) rotate(360deg)', opacity:0}
        ],{duration:1600+Math.random()*900,delay:Math.random()*200});
      }
      setTimeout(()=>document.body.removeChild(confetti),2600);

      setTimeout(() => {
        envelopeStage.style.opacity = 1;
        envelopeStage.style.transform = 'scale(1)';
      }, 50);
    });

    envelopeBtn.addEventListener('click', () => {
      letter.style.display = 'block';
    });
  </script>
</body>
</html>
